import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';

function User() {
    const [name,setName] = useState("John Doe");

    const changeName = () => {
        setName("Arvind B S");
    }
    return ( <>
        <h2>Welcome {name}</h2>
        <Button variant="info" onClick={changeName}>Change Name</Button>
    </> );
}

export default User;
